import React, {useEffect} from 'react';
import {useNavigate} from 'react-router-dom';

export const PageResult = () => {
    const naviGate = useNavigate();
    window.alert('ここではさらなる地獄があなたを待っています。\r\n道中の選択肢で別の選択をしてみましょう');
    const startPage = () => {
        naviGate('/');
    };
    return (
        <>
            <button onClick={startPage}>スタートに戻る</button>
        </>
    );
};
